                <div class="column">
                <ShortCard name="Deapdool" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSVBZGrdnMzJNJg2zeSE-bhotNzCJ5nXKcgVQ&usqp=CAU"/>
